INSERT INTO `notas` (`id`, `titulo`, `texto`, `imagen`, `status`, `category_id`, `created_at`, `updated_at`) VALUES
(1, 'Condiciones de uso online', '<p>El sitio web&nbsp;&nbsp;<span style=\"color: #000000;\"><span style=\"color: #000000;\"><strong><u>saldeello</u></strong></span><a style=\"color: #000000;\" href=\"saldeello.com\">.com</a><span style=\"color: #000000;\">&nbsp;</span></span> permite crear, compartir y gestionar&nbsp; publicaciones de ventas, servicios y crear su comercio digital en el cual le pone un banner y el logo del comercio para centralizar todas sus publicaciones en un solo lugar.</p>\r\n<p>El contenido est&aacute; sujeto a condiciones de uso.&nbsp; saldeello.com contiene contenido p&uacute;blico y compartido que suele estar disponible para todo el publico de la provincia de Tucuman y el Mundo donde se pueda ingresar a Internet, incluyendo algunos datos de contacto del vendedor, como tel&eacute;fono email, en caso de servicios puede aparecer el nombre del publicador.</p>\r\n<p><strong>Leyes de copyright.</strong> No debe publicar material con derechos de autor en saldeello.com , a no ser que disponga de un permiso expreso para hacerlo. Esto incluye, entre otros, mapas, capas, servicios, texto, fotograf&iacute;as, im&aacute;genes y capturas de pantalla.&nbsp;</p>\r\n<p>Usted es responsable del contenido&nbsp; compartidos por su nombre de usuario y debe utilizar el contenido asumiendo el riesgo correspondiente, saldeello.com no se responsabiliza de publicaci&oacute;n con precios mal cargados, o estafas ya que es solamente un portal de catalogo donde las personas publican y tienen contacto directo con el comprador, se recomienda tener precauci&oacute;n y si ve alguna publicaci&oacute;n enga&ntilde;osa por favor rep&oacute;rtela con nosotros para su inmediata baja.</p>\r\n<p>Sea respetuoso. No utilice lenguaje obsceno, racista o sexualmente expl&iacute;cito. saldeello.com se reserva el derecho de eliminar los usuarios&nbsp; que sean abusivas, que expresen odio o difamen o insulte a cualquiera. saldeello.com tambi&eacute;n se reserva el derecho a eliminar los elementos y usuarios que no est&eacute;n relacionados con la informaci&oacute;n geogr&aacute;fica.</p>', NULL, '1', NULL, '2020-05-18 20:38:00', '2020-05-28 20:54:11'),
(2, 'POLÍTICA DE PRIVACIDAD', '<p>El&nbsp; presente documento de Pol&iacute;tica de Privacidad establece los t&eacute;rminos en que&nbsp;<span style=\"color: #0000ee;\"><strong><u>saldeello</u></strong></span><a style=\"font-weight: bold;\" href=\"saldeello.com\">.com</a> usa y protege la informaci&oacute;n que es proporcionada por sus usuarios al momento de utilizar su sitio web. Esta plataforma est&aacute; comprometida con la seguridad de los datos de sus usuarios. Cuando le pedimos llenar los campos de informaci&oacute;n personal con la cual usted pueda ser identificado, lo hacemos asegurando que s&oacute;lo se emplear&aacute; de acuerdo con los t&eacute;rminos de este documento. Sin embargo esta Pol&iacute;tica de Privacidad puede cambiar con el tiempo o ser actualizada por lo que le recomendamos y enfatizamos revisar continuamente esta p&aacute;gina para asegurarse que est&aacute; de acuerdo con dichos cambios.</p>\r\n<p><strong>Informaci&oacute;n que es recogida</strong></p>\r\n<p><span style=\"color: #0000ee;\"><strong><u>saldeello</u></strong></span><strong><a href=\"saldeello.com%20\">.com</a> </strong>&nbsp;podr&aacute; recoger informaci&oacute;n personal por ejemplo: Nombre,&nbsp; informaci&oacute;n de contacto como&nbsp; su direcci&oacute;n de correo electr&oacute;nica e informaci&oacute;n demogr&aacute;fica. As&iacute; mismo cuando sea necesario podr&aacute; ser requerida informaci&oacute;n espec&iacute;fica para procesar alg&uacute;n pedido.</p>\r\n<p><strong>Uso de la informaci&oacute;n recogida</strong></p>\r\n<p><span style=\"color: #0000ee;\"><strong><u>saldeello</u></strong></span><strong><a href=\"saldeello.com%20\">.com</a> </strong>&nbsp;emplea la informaci&oacute;n con el fin de proporcionar el mejor servicio posible, particularmente para mantener un registro de usuarios, de pedidos en caso que aplique, y mejorar nuestros productos y servicios.&nbsp; Es posible que sean enviados correos electr&oacute;nicos peri&oacute;dicamente a trav&eacute;s de nuestro sitio con ofertas especiales, nuevos productos y otra informaci&oacute;n publicitaria que consideremos relevante para usted o que pueda brindarle alg&uacute;n beneficio, estos correos electr&oacute;nicos ser&aacute;n enviados a la direcci&oacute;n que usted proporcione y podr&aacute;n ser cancelados en cualquier momento.</p>\r\n<p>saldeello.com est&aacute; altamente comprometido para cumplir con el compromiso de mantener su informaci&oacute;n segura. Usamos los sistemas m&aacute;s avanzados y los actualizamos constantemente para asegurarnos que no exista ning&uacute;n acceso no autorizado.</p>\r\n<p><strong>Cookies</strong></p>\r\n<p>Una cookie se refiere a un fichero que es enviado con la finalidad de solicitar permiso para almacenarse en su ordenador, al aceptar dicho fichero se crea y la cookie sirve entonces para tener informaci&oacute;n respecto al tr&aacute;fico web, y tambi&eacute;n facilita las futuras visitas a una web recurrente. Otra funci&oacute;n que tienen las cookies es que con ellas las web pueden reconocerte individualmente y por tanto brindarte el mejor servicio personalizado de su web.</p>\r\n<p>Nuestro sitio web emplea las cookies para poder identificar las p&aacute;ginas que son visitadas y su frecuencia. Esta informaci&oacute;n es empleada &uacute;nicamente para an&aacute;lisis estad&iacute;stico y despu&eacute;s la informaci&oacute;n se elimina de forma permanente. Usted puede eliminar las cookies en cualquier momento desde su ordenador. Sin embargo las cookies ayudan a proporcionar un mejor servicio de los sitios web, est&aacute;s no dan acceso a informaci&oacute;n de su ordenador ni de usted, a menos de que usted as&iacute; lo quiera y la proporcione directamente . Usted puede aceptar o negar el uso de cookies, sin embargo la mayor&iacute;a de navegadores aceptan cookies autom&aacute;ticamente pues sirve para tener un mejor servicio web. Tambi&eacute;n usted puede cambiar la configuraci&oacute;n de su ordenador para declinar las cookies. Si se declinan es posible que no pueda utilizar algunos de nuestros servicios.</p>\r\n<p><strong>Enlaces a Terceros</strong></p>\r\n<p>Este sitio web pudiera contener enlaces a otros sitios que pudieran ser de su inter&eacute;s. Una vez que usted de clic en estos enlaces y abandone nuestra p&aacute;gina, ya no tenemos control sobre al sitio al que es redirigido y por lo tanto no somos responsables de los t&eacute;rminos o privacidad ni de la protecci&oacute;n de sus datos en esos otros sitios terceros. Dichos sitios est&aacute;n sujetos a sus propias pol&iacute;ticas de privacidad por lo cual es recomendable que los consulte para confirmar que usted est&aacute; de acuerdo con estas.</p>\r\n<p><strong>Control de su informaci&oacute;n personal</strong></p>\r\n<p>Esta plataforma saldeello.com no vender&aacute;, ceder&aacute; ni distribuir&aacute; la informaci&oacute;n personal que es recopilada sin su consentimiento, salvo que sea requerido por un juez con un orden judicial.</p>\r\n<p>ventastucuman.com Se reserva el derecho de cambiar los t&eacute;rminos de la presente Pol&iacute;tica de Privacidad en cualquier momento.</p>', NULL, '1', NULL, '2020-05-18 20:43:00', '2020-05-28 20:53:38'),
(3, '¡ Quienes somos !', '<p><strong>saldeello.com</strong>&nbsp;es un sitio web de compra venta y clasificados digitales que funciona en&nbsp;<strong>Rep&uacute;blica Dominicana</strong>&nbsp;el cual tiene como objetivo potenciar el comercio electr&oacute;nico y unir compradores y vendedores desde cualquier parte del pa&iacute;s ya que somos un marketplace abierto a todo aquel que quiera potenciar tu negocio o crear una tienda virtual en nuestro sitio web.</p>\r\n<p>saldeello.com fue fundada en marzo del 2020 por<strong>&nbsp;Junior Lorenzo</strong>&nbsp;y&nbsp;<strong>Willy Arredondo</strong>&nbsp;mientras pensaban en una idea sobre como&nbsp;<strong>ayudar a personas con pocos recursos pero con muchas ganas de salir adelante</strong>&nbsp;y no cuentan con una pagina web, entonces&nbsp; pensamos en saldeello.com haciendo referencia a un termino Dominicano cuando alguien quiere vender o salir de algo que posee.</p>\r\n<p>Actualmente en nuestro marketplace los usuarios puedes crear tiendas virtuales y tener una pagina exclusivamente con sus publicaciones, nuestro sitio cuenta con un clasificado de servicios donde las personas pueden contratar distintos servicios de forma directa con el vendedor, en si<strong>&nbsp;las ventas se concretan directamente entre compradores y vendedores, nosotros solamente los conectamos.</strong></p>\r\n<p><strong>&iquest; Que pedo hacer en el saldeello.com ?</strong></p>\r\n<ul>\r\n<li>Publicar productor y servicios</li>\r\n<li>Crear una tienda digital o cargar un comercio con logo y banner</li>\r\n<li>Importar productos desde Mercado Libre.</li>\r\n</ul>\r\n<p><strong>&iquest; Como hago para registrarme ?</strong></p>\r\n<p>Muy f&aacute;cil, solamente tienes que contar con una cuenta de Facebook o Google o lo puedes hacer con el m&eacute;todo tradicional a trav&eacute;s de nuestro formulario de registro.</p>\r\n<p><strong>&iquest; Es seguro navegar por el sitio y las publicaci&oacute;n ?</strong></p>\r\n<p>saldeello.com tiene control sobre lo que se publica, aunque es una tarea dif&iacute;cil controlar la calidad del producto ya que no pasa por nuestras manos, el vendedor publica y el comprador lo contacta directamente, pero tenemos un sistema de reporte de publicaciones por el cual cuando un usuario nota una publicaci&oacute;n enga&ntilde;osa o con fines delictivos puede denunciar y nuestro equipo toma las medidas necesarias, para garantizar una excelente experiencia de usuario, tambi&eacute;n nuestro sitio cuenta con un certificado de seguridad, que permite a los usuarios navegar seguros en el sitio web.</p>\r\n<p>saldeello.com la experiencia de vender en linea creando una tienda virtual.</p>', NULL, '1', NULL, '2020-06-10 07:59:02', '2020-06-10 07:59:02');
