(4, 5, 'Soporte de Cobros', 10, 'Ubicación: Santo Domingo (República Dominicana)', 'servicio@bancocaribe.com.do', 'Banco Caribe\r\nBanco Multiple Caribe Internacional S.A. nace en el 2004 por un grupo de accionistas liderado por los señores José Hernández Andújar y Edmundo Aja Fleites.\r\n\r\nDesde entonces y a la fecha, Banco Múltiple Caribe Internacional se ha caracterizado por la innovación y el crecimiento al desarrollar lineas de negocio innovadoras, penetrando en segmentos nuevos en el mercado. En la actualidad la entidad cuenta con mas de 700 empleados a nivel nacional, distribuidos en 4 oficinas corporativas importantes y 23 sucursales.\r\n\r\nDescripción de la oferta\r\nPropósito general:\r\n\r\nBrindar asistencia y soporte a todos los departamentos de la vicepresidencia a fines de descargar la parte operativa para el buen uso de la negociación y cobranza, siguiendo las normas, políticas y procedimientos de la Institución.\r\n\r\n \r\n\r\nPrincipales funciones y responsabilidades:\r\n\r\nRealizar las negociaciones y acuerdo de pagos a los(as) clientes(as) solicitados(as), así como dar seguimiento y mantener contacto con ellos(as) hasta que formalicen la negociación y los productos queden en cero.\r\nBrindar soporte a las oficinas de abogados(as) en las diferentes solicitudes de consultas de balance e informaciones.\r\nReportar reclamaciones realizadas por clientes(as) (diferentes tipos) para que se ejecuten las tareas de lugar.\r\nCanalizar a través del/la supervisor(a) el manejo de excepciones.\r\nRealizar cualesquiera tareas que le asigne la línea de mando directa, las cuales correspondan con la naturaleza de su cargo.\r\nRequisitos\r\nRequisitos:\r\n\r\nEstudiante de: Administración de Empresas, derecho, contabilidad\r\nConocimientos de técnicas de Cobranza y Servicio al Cliente\r\nOrientación a Resultados\r\nComunicación Constructiva\r\nOrientación al Cliente\r\nProactividad\r\nCapacidad de análisis\r\nTrabajo en Equipo\r\n\r\nsi quieres llenar el formulario aqui te dejamos el link :\r\nhttps://bancocaribe.talentclue.com/es/node/add/cv/job/26843453/company/24213656/4590/modal?clicked_button=apply_manually', NULL, 0, 'Banco Caribe', '2020-07-26 04:08:43', '2020-10-28 08:32:35', NULL),
(5, 5, 'Pasante Recursos Humanos', 3, 'Santo Domingo, República Dominicana', 'empleoretail@gmail.com', 'Nombre del puesto:\r\nPasante Recursos Humanos\r\n\r\nFunciones:\r\nColaborar en todos los subsistemas de RRHH\r\n\r\nRequisitos:\r\nDebe residir en la República Dominicana\r\n\r\nSexo:\r\nFemenino\r\n\r\nEdad:\r\nMayor de 18 años\r\n\r\nNombre de la empresa:\r\nConfidencial\r\n\r\nActividad de la empresa:\r\nConfidencial\r\n\r\nTipo de Contrato:\r\nTemporal\r\n\r\nJornada:\r\nTiempo completo\r\n\r\nHorario de trabajo:\r\nA discutir en la entrevista\r\n\r\nSalario:\r\nA discutir en la entrevista\r\n\r\nBeneficios:\r\nA discutir en la entrevista\r\n\r\nUbicación:\r\nSanto Domingo, República Dominicana\r\n\r\nAutorización de trabajo:\r\nCualquier persona que pueda trabajar legalmente en Rep. Dom. puede solicitar este empleo. Si actualmente no está autorizado para trabajar en República Dominicana, el empleador y/o empresa NO considerará su solicitud de empleo.\r\n\r\nComentarios:\r\nFavor NO aplicar si no cumple con los requisitos antes mencionados.\r\n\r\n¿Cómo aplicar?\r\nAplica desde Chiripas.com, utiliza el botón verde para enviar tu curriculum y el azul si necesitas crear uno:\r\n\r\nhttps://chiripas.com/sdrpr/62492-buscamos-pasante-recursos-humanos-santo-domingo', NULL, 0, 'Pasante Recursos Humanos', '2020-07-26 04:20:52', '2020-10-28 08:32:35', NULL),
(6, 5, 'Lavador para Carwash', 3, 'Bávaro, Verón o Friusa', 'massielninaconsultoria@gmail.com', 'Nombre del puesto:\r\nLavador para Carwash\r\n\r\nRequisitos:\r\nHombre (18-30 años)\r\nExperiencia en lavado de vehículos.\r\nResidir en Bávaro, Verón o Friusa. Disponibilidad inmediata.\r\n\r\n¿Cómo aplicar?\r\nFavor enviar cv al correo massielninaconsultoria@gmail.com\r\n\r\nAviso importante: Esta oferta de empleo ha sido proporcionada directamente por el empleador a través del sistema de publicación de empleos de Chiripas. El equipo de Chiripas ha tomado medidas para asegurarse de que sea real y confiable, pero no puede garantizar su autenticidad.\r\nAdvertisements\r\n\r\naqui el link :\r\n\r\nhttps://chiripas.com/laeos/62493-vacante-lavador-para-carwash-bavaro-veron-o-friusa', NULL, 0, 'Lavador para Carwash', '2020-07-26 04:23:01', '2020-10-28 08:32:35', NULL),
(7, 5, 'Administrador de Base de Datos (DBA)', 3, 'Santo Domingo', 'vacantesrd@gmail.com', 'Necesitamos un candidato con experiencia Administrador de Base de Datos (DBA)\r\n\r\nNombre del puesto:\r\nAdministrador de Base de Datos (DBA)\r\n\r\nRequisitos:\r\nProfesional del área de informática.\r\nPoseer experiencia mínima de 2 años en administración de bases de datos.\r\nConocimientos M SQL (Mandatorio)\r\nDisponibilidad de horario (Necesario)\r\nResponsable\r\nDiscreto\r\n\r\n¿Cómo aplicar?\r\nAplica desde Chiripas.com, utiliza el botón verde para enviar tu curriculum y el azul si necesitas crear uno:\r\n\r\nhttps://chiripas.com/sdtti/62495-puesto-vacante-administrador-de-base-de-datos-dba', NULL, 0, 'Administrador de Base de Datos (DBA)', '2020-07-26 04:26:53', '2020-10-28 08:32:35', NULL),
(8, 5, 'Agente Comercial', 3, 'Santiago', 'vacantesrd@gmail.com', 'Nombre del puesto:\r\nAgente Comercial (Santiago)\r\n\r\nFunciones:\r\nEl objetivo de esta posición es gestionar la relación con clientes existentes y potenciales según asignación a través de diferentes actividades comerciales, entre otras, pero no limitadas a: visitas personales y llamadas, con el objetivo de generar y maximizar ingresos\r\n\r\nRequisitos:\r\nDebe residir Santiago o zonas aledañas\r\nMínimo 1 año de experiencia en áreas afines\r\nVehículo propio\r\n\r\nSexo:\r\nIndistinto\r\n\r\nEdad:\r\nMayor de 18 años\r\n\r\nNombre de la empresa:\r\nConfidencial\r\n\r\nActividad de la empresa:\r\nGestión de espacios exclusivos en el aeropuerto internacional del Cibao y otros aeropuertos.\r\n\r\nTipo de Contrato:\r\nFijo\r\n\r\nJornada:\r\nTiempo completo\r\n\r\nHorario de trabajo:\r\nL-V 9am-5pm\r\n\r\nSalario:\r\nA discutir en la entrevista\r\n\r\nBeneficios:\r\nTodos los de Ley\r\nComisiones atractivas\r\nSubsidio de combustible\r\nMantenimiento de vehículo\r\n\r\nUbicación:\r\nSantiago De Los Caballeros, República Dominicana\r\n\r\nAutorización de trabajo:\r\nCualquier persona que pueda trabajar legalmente en Rep. Dom. puede solicitar este empleo. Si actualmente no está autorizado para trabajar en República Dominicana, el empleador y/o empresa NO considerará su solicitud de empleo.\r\n\r\nComentarios:\r\nFavor NO aplicar si no cumple con los requisitos antes mencionados.\r\n\r\n¿Cómo aplicar?\r\nAplica desde Chiripas.com, utiliza el botón verde para enviar tu curriculum y el azul si necesitas crear uno:\r\n\r\nhttps://chiripas.com/sgcnr/62494-se-solicita-agente-comercial-en-santiago', NULL, 0, 'Agente Comercial', '2020-07-26 04:28:20', '2020-10-28 08:32:35', NULL),
