(10, 5, 'Coordinador/a de Operaciones ( Importación/ Exportación) (Ob', 2, 'Santo Domingo', 'ygonzalez@ctcdo.com', 'Hola soy encargada de recursos humanos en una empresa de logística estoy buscando candidatos en él área de mercadeo, negocios internacionales y carreras a fines.  En Santo Domingo \r\n\r\n\r\nPosición: Coordinador/a de Operaciones ( Importación/ Exportación) (Obligatorio) \r\n\r\nExperiencia: 1 - 2 años (Obligatorio) \r\n\r\nSalario: 30 a 35 mil ( acorde a su experiencia) beneficios de Ley. \r\n\r\nCompetencias técnicas: paquete office,outlook, habilidades de redacción, dominio del inglés. \r\n\r\nObjetivo: coordinar y manejar cargas consignadas en importación marítima, aérea , enlace de ventas y agentes. \r\n\r\nCompetencias conductuales: Orientado al servicio, pro activo, comprometido/a, orientado al servicio y comunicación efectiva. \r\n\r\nEnviar CV a: ygonzalez@ctcdo.com (solo si cumple con los requisitos)\r\n\r\nhttps://www.empleosrodriguez.com/2020/07/coordinadora-de-operaciones-importacion.html', NULL, 0, 'Coordinador/a de Operaciones ( Importación/ Exportación) (Obligatorio)', '2020-07-26 04:33:39', '2020-10-28 08:32:35', NULL),
