(483, 1070, 29, 428, NULL, NULL, 1, NULL, 'COMPLEMENTO PARA INGENIEROS, LEER MAS!', 'SALUDOS!\r\n\r\nSI ERES INGENIERO Y QUIERES CONSTRUIR, TENEMOS ESTAS OPCIONES A SU DISPOSICION:\r\n\r\nVENTA DE CERAMICAS\r\nVENTA AL POR MAYOR DE TODO TIPO DE PINTURAS,ACRILICAS, GLOSS, SEMIGLOS, SELLADORAS Y MAS.\r\nSOLARES Y TERRENOS, URBANOS Y TURISTICOS EN VENTA\r\nFACILIDADES PARA TERMINAR SU PROYECTO\r\nINSTALACION Y VENTA DE JACUZZYS Y PISCINAS\r\nINSTALACION Y VENTA DE FILTROS DE AGUA\r\n\r\nLLAME YA!\r\n\r\nCONTACTO\r\nALICE\r\nWHATSAPP\r\n829-584-3911\r\n829-256-7550 (LOCAL)', 999, NULL, 'PUBLISHED', 'NUEVO', '2022-03-24', '2021-12-25 01:37:49', '2021-12-25 01:37:49', NULL, NULL),
(484, 1070, 29, 428, NULL, NULL, 1, NULL, 'Filtros de agua, instalacion y venta, cotizacion GRATIS!', 'Saludos!\r\n\r\nTenemos en venta, filtros de agua para que el agua sea lo mas limpia e higienica posible!\r\n\r\nLiberse ya y de una vez por todas de las enfermedades causadas por beber agua de mala calidad!\r\n\r\nCotizamos y nos trasladamos totalmente gratis en todo el pais y lo hacemos via whatsapp tambien\r\n\r\nDsponibles para instalar y vender a hoteles, restaurantes, proyectos de apartamentos en construccion, condominios de apartamentos , clinicas, hospitales, area de dialisis y muchos negocios mas, venta para particulares y empresas disponible tambien!\r\n\r\nCotizacion a solicitud del interesado\r\n\r\n¨la salud es lo que mas me preocupa, dejame comprar el mio, para tener mi agua filtrada ¨\r\n\r\nEscribir via Whatsapp o llamar al numero local.\r\n\r\nEscriba directo via whatsapp!\r\n\r\nAlice\r\n\r\nWhatsapp\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Numero local)', 999, NULL, 'PUBLISHED', 'NUEVO', '2022-03-24', '2021-12-25 01:39:11', '2021-12-25 01:39:11', NULL, NULL),
