(781, 898, 29, 424, NULL, NULL, 1, 101, 'Clases de violin para niños, jovenes y adultos!', 'HOLA!!\r\n\r\nIMPARTIMOS CLASES PARTICULARES DE VIOLIN Y VIOLENCHELO!!!\r\n\r\nNO IMPORTA SI ERES ADULTO, JOVEN, CHICO O MUY CHICO, CON MUCHO AMOR Y PACIENCIA TE ENSEÑAMOS A TOCAR ESTE BELLO INSTRUMENTO, CON TODAS LAS MEDIDAS DE HIGIENE Y SEGURIDAD!!!\r\n\r\nIMPARTIMOS NUESTRAS CLASES A NIÑOS, JOVENES, ADULTOS, NOVATOS, PRINCIPIANTES, APRENDIZ, AVANZADO, TODO AQUEL QUE DESEE APRENDER VIOLIN, SON BIENVENIDOS AQUI!\r\n\r\n¨SACA EL ARTISTA QUE LLEVAS DENTRO¨\r\n\r\nPARA MAS DETALLES E INFORMACION, ESCRIBA O LLAME VIA WHATSAPP 24/7\r\n\r\nALICE\r\n\r\nWHATSAPP 24/7\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Local)\r\n\r\n“NUNCA ES TARDE PARA APRENDER ALGO NUEVO”', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 07:29:26', '2022-11-10 07:29:26', NULL, NULL),
(782, 898, 29, 435, NULL, NULL, 1, 101, 'Diseños de paginas web para profesionales y particulares!', 'SALUDOS!\r\n\r\nDISEÑAMOS SU PAGINA WEB EMPRESARIAL O PERSONAL, EN TIEMPO RECORD Y CON PROFESIONALIDAD!\r\n\r\nAUMENTANDO EL TRAFICO DE VISITAS A SU PAGINA Y AL MISMO TIEMPO ELEVANDO SU PRODUCTIVIDAD!\r\n\r\nLE HACEMOS SU PAGINA WEB, CON VIDEOS TUTORIALES EN YOUTUBE Y EN VARIOS IDIOMAS, SI ASI USTED LO DESEA!\r\n\r\nDEJE EN NUESTRAS MANOS UNA PAGINA WEB DISEÑADA A SU ESTILO, CON ALTOS ESTANDARES DE CALIDAD!\r\n\r\nCONTACTARME VIA WHATSAPP!\r\n\r\nALICE\r\n\r\nWHATSAPP 24/7\r\n829-584-3911\r\n809-446-3911', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 07:30:08', '2022-11-10 07:30:08', NULL, NULL),
