(786, 898, 451, 453, NULL, NULL, 1, 101, 'Negocios, inversiones y mucho mas!!', 'Hola!\r\n\r\nEn estos tiempos en que vivimos a raiz del covid-19, increiblemente se han incrementado las oportunidades para invertir y es ahora justo cuando debes hacerlo!\r\n\r\nEn Republica Doominicana, tenemos apartamentos de oportunidad desde us 100 mil dolares en adelante, negocios con buena rentabilidad y retorno de inversion garantizada, edificios comerciales y residenciales, estaciones de combustible y terrenos con permisos, terrenos, fincas y solares, en todo el pais, ganaderas, agricolas, comerciales y para construir!\r\n\r\nAprovecha e invierte y luego recupera tu inversion!\r\n\r\nSiguenos en Facebook como Caribbean Properties y revise todas las opciones que hay para comprar, invertir y negociar!!\r\n\r\nEscriba directo via whatsapp!\r\n\r\nAlice\r\n\r\nWhatsapp\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Numero local)\r\n\r\nSitio Web:: https://www.facebook.com/By.LeblancG/', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 07:40:38', '2022-11-10 07:40:38', NULL, NULL),
(787, 898, 451, 454, NULL, NULL, 1, 101, 'Invierte en el negocio de Estaciones de Combustible!', 'Saludos!\r\n\r\nSi esta pensando que negocio seria bueno para invertir?\r\n\r\nPues puedo decirte que las Estaciones de Combustibles generan excelentes ingresos y hay buena rentabilidad y retorno de inversion en corto plazo!\r\n\r\nTenemos estaciones de combustible con contratos vencidos y otras con contratos a punto de vencer en venta en diferentes puntos del pais asi como terrrenos con permisos ya aprobados para instalar y construir su estacion, venta de gasoil d2 (contrato anual), licencias de importacion y exportacion y mucho mas!!\r\n\r\nSiguenos en Facebook como Caribbean Properties y analice todas las opciones para comprar e invertir en el pais!\r\n\r\nEscribir via whatsap\r\n\r\nEscriba directo via whatsapp!\r\n\r\nAlice\r\n\r\nWhatsapp\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Numero local)\r\n\r\nSitio Web:: https://www.facebook.com/By.LeblancG/', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 08:04:26', '2022-11-10 08:04:26', NULL, NULL),
(788, 898, 29, 438, NULL, NULL, 1, 101, 'Realizamos pinturas exoticas para su negocio!!!', 'HOLA!!\r\n\r\nREALIZAMOS PINTURAS EN PAREDES DE RESTAURANTES, HOTELES Y NEGOCIOS EN TODO EL PAIS!!\r\n\r\nDEJE EN NUESTRAS MANOS ESE TOQUE EXOTICO QUE LE FALTA A SU NEGOCIO!!\r\n\r\nCOTIZAMOS GRATIS EN TODO EL PAIS!!\r\n\r\nPARA:\r\n\r\nRESTAURANTES\r\nHOTELES\r\nCOLEGIOS\r\nEMPRESAS\r\nINAUGURACIONES\r\nY PERSONALES PARA LAS HABITACIONES DE SUS HIJOS, LA DECORAMOS Y PINTAMOS A SU GUSTO!!\r\n\r\nIMAGINE COMO QUIERE TENER DECORADO SU NEGOCIO O SU HOGAR Y LLAMENOS!!!\r\n\r\nESCRIBA VIA WHATSAPP 24/7\r\n\r\nALICE\r\nWHATSAPP 24/7\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Local)\r\n\r\nSitio Web:: https://www.facebook.com/By.LeblancG/', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 08:05:22', '2022-11-10 08:05:22', NULL, NULL),
