(790, 898, 29, 438, NULL, NULL, 1, 101, 'Retratos pintados al oleo y al carboncillo!', 'Saludos!!\r\n\r\nQuieres sorprender a esa persona ESPECIAL y no sabes que regalarle??\r\n\r\nEl mejor regalo que puedes hacerle es un retrato dibujado al carboncillo!!\r\n\r\nEste regalo va a sorprender tanto a esa persona como no lo imaginas!!\r\n\r\nHacemos la prueba? SOLICITA EL TUYO Y SORPRENDE CON TREMENDO REGALO!!\r\n\r\nSE LO MANDAMOS A ENCUENDRAR SI USTED ASI LO DESEA!! (A solicitud del interesado y a un costo adicional)\r\n\r\nUna de estos bellos retratos PUEDE SER EL SUYO!!\r\n\r\nCotizar via whatsapp!\r\n\r\nAlice\r\n\r\nWhatsapp\r\n\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Local)\r\n\r\n¨Dios mio, que regalo tan maravilloso, DEJAME ENCARGARLO AHORA MISMO¨', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 08:07:09', '2022-11-10 08:07:09', NULL, NULL),
