(820, 898, 451, 453, NULL, NULL, 1, 101, 'Desde que dicen playa! Tu solo piensas: ah, punta cana!!', 'Y es que Punta Cana lo tiene todo!\r\n\r\nEmpezando por sus paradisiacas playa scolor azul turquesa que nos embriagan y nos enamoran solo de pensarlo!\r\n\r\nBlancas y suaves arenas rodeadas de palmeras, como no querer tener un pedacito de ella!\r\n\r\nApartamentos y villas en la playa, frente, cerca y proximo!\r\n\r\nNuevos, usados, proyectos en construccion donde puedes desde ya separar, reservar y firmar su contrato!\r\n\r\nAproveche su viaje a Republica Dominicana y no se vaya sin adquirir una de nuestras propiedades en el caribe!\r\n\r\nPlanes de financiamientos con comodas cuotas para financiar si asi lo requiere!\r\n\r\nEn Punta Cana donde todos quieren comprar e invertir , cuya rentabilidad esta 100% garantizada!!\r\n\r\nTerrenos lineales a la playa para sus proyectos en construccion como son hoteles, villas y negocios turisticos!\r\n\r\nY mucho, mucho mas!\r\n\r\nVisitanos y siguenos en Facebook e Instagram como Caribbean Properties donde podras ver varias opciones para comprar, financiar e invertir, no solo en punta cana sino en todo el pais!\r\n\r\nConectate conmigo via whatsapp escribiendo desde cualquier lugar!\r\n\r\nAlice\r\n\r\nWhatsapp 24/7\r\n\r\n1-829-584-3911\r\n\r\n1-809-446-3911\r\n\r\n1-829-256-7550 Local\r\n\r\nPunta Cana sencillamente lo tiene todo, es ahi donde quiero comprar e invertir, dejame contactarla ahora mismo!\r\n\r\nhttps://www.facebook.com/By.LeblancG/', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 08:34:16', '2022-11-10 08:34:16', NULL, NULL),
(821, 898, 451, 453, NULL, NULL, 1, 101, 'Caribbean properties, mi propiedad en el caribe!!', 'Caribbean properties, mi propiedad en el caribe!!\r\n\r\n¨EL CARIBE, SUS PLAYAS, SUS PROPIEDADES CON VISTA AL MAR Y DIVERSOS NEGOCIOS, ES SIMPLEMENTE EL MEJOR LUGAR PARA INVERTIR Y COMPRAR¨\r\n\r\nQUE PUEDES ENCONTRAR EN CARIBBEAN PROPERTIES:\r\n\r\nAPARTAMENTOS Y VILLAS EN LA PLAYA!\r\nLUXURY PROPERTIES!!\r\nAPARTAMENTOS EN LA CIUDAD, CON VISTAS AL MAR, EN LUGARES CENTRICOS, CERCA DE TODO!!\r\nLOCALES COMERCIALES EN VENTA Y ALQUILER!!\r\nNAVES EN ALQUILER Y VENTA EN DIFERENTES PUNTOS ESTRATEGICOS!!\r\nCASAS Y VILLAS VACACIONALES, EN ALQUILER POR CORTA, LARGA ESTADIA!!\r\nAPARTAMENTOS CON VISTA AL MAR, AMUEBLADOS, ALQUILER TEMPORAL!!\r\nAPARTAMENTOS Y PENTHOUSES DESDE US 75 MIL DOLAR, VISTA AL MAR, EL CUAL PUEDE COMPRAR Y REVENDER!!\r\nEDIFICIOS Y NEGOCIOS, GENERANDO EXCELENTES INGRESOS, REALMENTE SON OPORTUNIDADES!!\r\nESTACIONES DE COMBUSTIBLE, TERRENOS CON PERMISOS, PROYECTOS Y TERRENOS CON PERMISOS APROBADOS Y MUCHO, MUCHO MAS!!!!\r\n\r\nCONTACTANOS YA Y DIGAME DONDE DESEA INVERTIR O COMPRAR!!\r\n\r\nALICE\r\nWHATSAPP 24/7\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Local)\r\n\r\nVISITANOS Y SIGUENOS EN INSTAGRAM Y EN FACEBOOK:\r\nCOMO CARIBBEAN PROPERTIES\r\n\r\n¨SIEMPRE SUEÑO CON TENER UNA PROPIEDAD EN EL CARIBE¨\r\n\r\nSitio Web:: https://www.facebook.com/Leblanc.Baez', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 08:34:58', '2022-11-10 08:34:58', NULL, NULL),
(822, 898, 451, 453, NULL, NULL, 1, 101, 'Apartamentos proximos al hotel hard rock, punta cana!!', 'HOLA!\r\n\r\nGALAXY, BLUE MARINA, CANA ROCK, CANA BAY, CORAL BAY 2, SON ALGUNOS DE LOSLUGARES DONDE TENEMOS COMPLEJOS DE APARTAMENTOS DISPONIBLES PARA LA VENTA, EN UNA UBICACION PRIVILEGIADA DE PUNTA CANA!\r\n\r\nEN EL LUGAR PARADISIACO MAS FAMOSO DE TODO EL CARIBE, PUNTA CANA, TENEMOS APARTAMENTOS Y PENTHOUSES CON ESPECTACULARES VISTA A LA PLAYA, RODEADO DE HERMOSAS PALMERAS Y LA BRISA EMBRIAGADORA DE ESTE PARAISO TROPICAL!\r\n\r\nAPARTAMENTOS DE 1,2 Y 3 HABITACIONES. 85 METROS EN ADELANTE\r\nPENTHOUSE DISPONIBLES!\r\nPRECIOS ADSEQUIBLES, PLANES DE FINANCIEMIENTO Y MUCHO MAS!\r\n\r\n\r\nACCESO A LAS INSTALACIONES DEL HOTEL HARD ROCK, CLUBES, TODO LO QUE NECESITA EN SU ENTORNO PARA DISFRUTAR EN SU APARTAMENTO CADA VEZ QUE VACACIONE, SI O QUIERE COMO INVERSION TENEMOS RAZONES DE PESO POR QUE INVERITR ALLI:\r\n\r\nRETORNO DE SU INVERSION ASEGURADA.\r\nCUOTAS MUY FLEXIBLES\r\nFACILIDADES CON BANCOS Y MUCHO MAS!\r\n\r\nAL MIRAR USTED LAS SIGUIENTES IMAGENES QUEDARA CONVENCIDO DE QUE SI VA A COMPRAR E INVERTIR!\r\n\r\nCONTACTANOS VIA WHATSAPP PARA DARLE LOS PRECIOS, LA DISPONIBILIDAD, LOS PLANES DE FINANCIAMIENTO Y COORDINAR LA CITA PARA LA VIVIENDA DE SUS SUEÑOS!\r\n\r\nSIGUENOS EN FACEBOOK COMO CARIBBEAN PROPERTIES Y VEA TODAS LAS OPCIONES QUE TENEMOS PARA USTED!\r\n\r\n\r\nALICE\r\nWHATSAPP 24/7\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Local)\r\n\r\n¨LA MEJOR INVERSION ES COMPRAR EN PUNTA CANA¨\r\n\r\nNOTA: \r\nTENEMOS PROYECTOS NUEVOS EN CONSTRUCCION DONDE PUEDES DESDE YA IR RESERVANDO,SEPARANDO Y FIRMANDO SU CONTRATO !\r\n\r\nhttps://www.facebook.com/By.LeblancG', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 08:36:29', '2022-11-10 08:36:29', NULL, NULL),
(823, 898, 451, 453, NULL, NULL, 1, 101, 'Apartamentos, villas y terrenos en PLAYA NUEVA ROMANA!', 'Hola!!\r\n\r\nPlaya Nueva Romana es un destino turistico muy visitado y adquirido donde sus propietarios han adquirido la satisfaccion de vivir en un lugar rodeado de palmeras, suaves arenas y el incomparable verdor de sus palmeras combinada con las paradisiacas playas del caribe!!\r\n\r\nEn este proyecto tenemos apartamentos y villas en venta, asi como terrenos, para construir a su gusto!!\r\n\r\nContamos con planes de financiamientos y comodas cuotas para pagar!!\r\n\r\nSolicite mas informacion, disponibilidad, precios y fotos contactando via whatsapp!!\r\n\r\nSiguenos en Facebook como Caribbean Properties y mire toda la variedad que tenemos para comprar, invertir y alquilar!!\r\n\r\nEscriba directo via whatsapp!\r\n\r\nAlice\r\n\r\nWhatsapp\r\n829-584-3911\r\n809-446-3911\r\n829-256-7550 (Numero local)\r\n\r\nhttps://www.facebook.com/By.LeblancG\r\n\r\nNOTA: TENEMOS PROYECTOS NUEVOS Y EN CONSTRUCCION DONDE PUEDES RESERVAR, SEPARAR Y FIRMAR SU CONTRATO, TERRENOS EN VENTA PARA QUE CONSTRUYA A SU GUSTO!\r\nINFORMESE MAS ESCRIBIENDO VIA WHATSAPP DESDE CUALQUIER LUGAR!', 1, NULL, 'PUBLISHED', 'NUEVO', '2023-02-08', '2022-11-10 08:38:17', '2022-11-10 08:38:17', NULL, NULL),
